INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4, 173, 'dsg-description', 'self', 'Multibranched with large stems in fully grown specimens. Branches large, fluffy and thick when feeding polyps are extended. Color is usually dark pink - reddish. Branches look bulbous when polyps are withdrawn and are flexible if touched. Small specimens should be compared to Corallium and Sibogogorgia cauliflora.', '20190102 09:19:53.040', '80E997E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(5, 338, 'dsg-description', 'self', 'Large and shaggy appearance. Branches moderate thickness. Color creamy with brown-yellow, sometimes orange hue. Long tendrils of unknown function found at base of stalk. Polyps contract and expand, but do not withdraw completely.', '20090101 00:00:00.0', '1FEA97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(6, 175, 'dsg-description', 'self', 'Densely branched fan-shaped. Branches thin, delicate, rusty red. It is possible that some of these animals are S. torreyi which are darker in color, with thinner branches and anastomosed branches. This taxonomic group may be in need of revision.', '20140805 08:16:52.913', '84E997E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8, 166, 'dsg-description', 'self', 'Salp chain often seen tightly coiled like an `ammo belt` (as per L. Madin).', '20150415 11:50:31.797', '75E997E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(9, 603, 'dsg-description', 'self', 'Contain chemosynthetic bacterial symbionts within their bodies that convert energy from sulphide- and methane-rich waters, supplying nutrition to the host worm.', '20150330 09:01:03.897', 'A2EB97E5-A724-E811-80E1-005056990C7D')
GO
