INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(30, 623, 'dsg-description', 'self', 'Compare with Opsithoteuthis. Relatively long fins (used for robust swimming), elongate mantle and body. Species appear to be associated with the deep ocean floor in all oceans of the world.', '20210504 08:02:00.843', 'C9EB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
