GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(36, 622, 'dsg-description', 'self', 'No defined bars or stripes, but look for an inverted "u" shape on the side under the dorsal fin; red and white; large eyes; concave forehead; commonly sit on the seafloor with the tail tucked beside the body; split nose rarely visible. Juveniles are more pelagic. Younger animals many appear light-pink and without apparent (or with very faint) markings. ', '20150421 09:10:26.693', 'C2EB97E5-A724-E811-80E1-005056990C7D')
GO
