INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(216, 436, 'dsg-description', 'self', 'Two sucker rows, massive mantle but small head, medium to short arms, smooth skin, small eyes; eyes do not protrude, when seen in males the ligula is pointy.', '20101112 09:26:12.333', 'B6EA97E5-A724-E811-80E1-005056990C7D')
