INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(219, 637, 'dsg-description', 'self', 'One sucker row, skin tuberculate (warty) or granular; funnel may be visible; primarily move by crawling over the substrate; also capable of swimming via jet propulsion and/or pumping the arms and flared webs; G. boreopacifica and G. pacifica may be two different species with G. boreopacifica ocurring shallower and with smoother, less conspicuous skin texture and minimal cirri over the eyes. ', '20110822 14:28:06.457', 'FDEB97E5-A724-E811-80E1-005056990C7D')
