  VALUES(241, 3762, 'dsg-range', 'self', 'Circumglobal, excluding the western Atlantic. Eastern Atlantic from Liberia to Nigeria.', '20111017 15:16:31.007', '0995BBE5-A724-E811-80E1-005056990C7D')
