INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(243, 3761, 'dsg-range', 'self', 'Eastern Atlantic, scattered records in the Mediterranean, off Cape Blanc in Mauritania, Azores, Gulf of Guinea and off equatorial Africa. Western Atlantic from USA to Gulf of Mexico including Caribbean and along Rio Grande Rise. Western Indian Ocean: Mozambique Channel. Elsewhere, equatorial western Pacific and eastern Pacific.', '20111017 15:10:10.813', '0595BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(247, 3794, 'dsg-description', 'self', 'Funiculina and Halipteris look the same on video and have overlapping depth ranges; mostly reddish-purple or pink with a white rachis, but can appear all white. Because Haliperis and Funiculina are indistinguishable per G. Williams, the morphotype is annotated as Funiculina-Halipetris complex when observed between 600-799 m).', '20190418 14:02:06.013', '4B95BBE5-A724-E811-80E1-005056990C7D')
GO
