INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(284, 1918, 'dsg-description', 'self', 'Jay Orr and others found the Rougheye in Alaska to be a complex and that there were two genetically distinct types (going under the name of aleutianus).  The second type was determined to be S. melanostictus, Blackspotted Rockfish. In a 2014 fishereies genetic study (NOAA), ~11% of the fish ID''d as S. aleutianus were in fact S. melanostictus.', '20150701 07:30:12.990', 'B6F197E5-A724-E811-80E1-005056990C7D')
GO
