INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(342, 1416, 'dsg-depth-distribution', 'self', '33 - 1306 m', '20160316 10:05:39.493', '14F097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(343, 1416, 'dsg-description', 'self', 'Long, broad, bell-shaped snout (shorter than A. kampae), deep body (humped in the mid section), can be dark or medium brown; you may see some subtle dark margins on the fins. Broad caudal fin, anal fin short and angular. Eye size is relatively small and gills slits realtively short, compared to A. kampae.', '20190123 13:30:11.527', '15F097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(344, 1417, 'dsg-depth-distribution', 'self', '180 to 1888 m', '20150331 10:29:31.420', '1AF097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(345, 1417, 'dsg-description', 'self', 'Long broad, bell-shaped snout with a white rectangle on the dorsal surface, deep body (humped in the mid section; trunk strongly tapering toward head), pinkish-brown to dark brown; posterior fin edges are white and can usually be seen on video. Rounded anal fin is approximately twice as long as it is high, broad caudal fin. Gill slits are relatively long and eye relatively large compared to A. brunneus.', '20190123 13:25:31.110', '1BF097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(346, 1419, 'dsg-depth-distribution', 'self', '91 - 1251 m', '20150420 13:29:01.063', '21F097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(347, 1419, 'dsg-description', 'self', 'These are the most abundant catshark in a lot of areas in the bay.  Eye is relatively large, elongate, oval. They have a short, rounded/blunt snout, nasal flaps broad and triangular. Slender and cylindrical; they don’t have the hump in the middle of the body like Apristurus species. Short gill slits. Gray-brown coloration dorsally, and white ventral side. Although not readily visible on most of the animals we observe, the fins can be dark, but with white edges. In the Gulf of California, these sharks co-occur with Cephalurus cephalurus and may be difficult to tell apart when distant, when small, and when they uncharacteristically have the gills expanded in a low O2 environment.', '20190123 13:09:35.640', '22F097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(348, 3917, 'dsg-description', 'self', 'Reddish-brown anterior, translucent tan body, narrow-lipped, short squat body when compared to TorquaratoridaeA sp. 1. Most have been observed on mud; one was atop lava.  ', '20210504 08:04:49.490', '4996BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(349, 3918, 'dsg-description', 'self', 'Transparent or reddish-brown anterior with transparent body, gonads visible, narrow-lipped.', '20101019 08:20:12.243', '5096BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(350, 3919, 'dsg-description', 'self', 'Translucent purple, extrawide-lipped with a very broad collar, high-dome proboscis and moderately-sinuate intestines.  ', '20101021 10:54:25.103', '5896BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(351, 3921, 'dsg-description', 'self', 'Dark brown anterior, light-colored posterior, moderately broad collar, low-dome, pointed proboscis, wide-lipped. Lighter colored at smaller sizes, and nearly colorless when very small. Commensal with polynoid worm Macellicephala sp. A.', '20180612 09:08:59.990', '6196BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(352, 3922, 'dsg-description', 'self', 'Transparent body, high dome proboscis and extra-wide lips which can be transparent, light or dark purple, very broad collar, genital wings sometimes visible, highly sinuate intestines. Wholly transparent specimens are found north of Monterey, while animals with a dark purple proboscis and lips were found to the south.  Specimens with light purple anteriors were seen throughout the range. ', '20150407 10:16:49.823', '6796BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(353, 491, 'dsg-description', 'self', 'Large; uniform white to light-medium gray. Snout extends beyond indented pectoral fins. May have slightly darker margins, and alar thorns are evident in some darker-colored males. Note the thick base of the tail (compare to B. abyssicola). Claspers may appear white-tipped in darker males.', '20160707 09:23:24.660', '10EB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(354, 491, 'dsg-size', 'self', 'to 150 cm TL.', '20160707 09:23:57.970', '11EB97E5-A724-E811-80E1-005056990C7D')
GO
