INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(382, 2994, 'dsg-range', 'self', 'Arctic, boreal Atlantic and Pacific; tropical western Atlantic Ocean.', '20150401 16:24:19.960', '8093BBE5-A724-E811-80E1-005056990C7D')
