INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(384, 3934, 'dsg-description', 'self', 'Very gelatinous. Chiroteuthis-like in appearance (long neck, body and fin shape) but is distinguished by subequal arms and fusion of each funnel-mantle locking apparatus. Scattered chromatophores and small eyes.', '20100922 15:52:22.453', '8E96BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(385, 3934, 'dsg-range', 'self', 'World-wide distribution in tropical to temperate seas.', '20101021 11:56:56.003', '8F96BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(386, 418, 'dsg-range', 'self', 'Lower mesopelagic to bathypelagic depth distribution within tropical to temperate oceans of the world.', '20100921 15:30:42.820', '97EA97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
