INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(388, 2961, 'dsg-size', 'self', 'Maximum size to 76 mm mantle length.', '20150401 16:25:35.997', '5693BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(389, 2961, 'dsg-description', 'self', 'Distinguished from subadults of other members of the genus by the small fins and few suckers on arms IV; long and decorative tail, which was first captured on video by MBARI''s ROV Tiburon in the Gulf of California.', '20150401 16:27:45.400', '5793BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(391, 2961, 'dsg-range', 'self', 'Has been described only from the waters off southern California and northern Baja California.', '20101026 09:09:51.710', '5893BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(393, 961, 'dsg-description', 'self', 'Often appear to have bloated bodies and short arms. Often observed in the "cockatoo posture" with the arms and tentacles folded back over the head.', '20100922 16:01:39.463', '5EEE97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(394, 963, 'dsg-size', 'self', '150 mm mantle length.', '20150505 15:57:26.807', '65EE97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(395, 963, 'dsg-description', 'self', 'The mantle is covered by large, multi-pointed cartilagenous tubercles. When disturbed, the squid often pulls its head and arms into the mantle cavity and folds its fins tightly against the mantle to form a turgid ball. The tubercules, presumably, provide some type of protection but it is unclear what predators are affected and how. In addition, the squid may ink into the mantle cavity, making the ball opaque.', '20100921 15:50:43.933', '66EE97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(396, 963, 'dsg-range', 'self', 'This species occurs throughout tropical and subtropical waters of the world''s oceans.', '20100921 15:51:55.703', '67EE97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
