INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(630, 3866, 'dsg-size', 'self', 'Bell is an average 10 mm diameter and 4.3 mm tall.', '20110113 15:26:42.917', 'DD95BBE5-A724-E811-80E1-005056990C7D')
