INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(631, 3866, 'dsg-description', 'self', 'Thick, transparent mesoglea is slightly thicker at the apex of the bell. Exumbrella is covered evenly with nematocysts. The manubrium is dark purple, short, and quadratic. Mouth is quadratic with light purple lips. Four simple radial canals with cream colored gonads. Gonads are large and sinuously folded. Up to 57 long tentacles.', '20110113 15:30:29.497', 'DE95BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(632, 3866, 'dsg-reproduction', 'self', 'The hydroid colonies of this species are found to be symbiotic on the shrimp Pasiphea pasicfica. The hydroid colonies are found on the dorsum of the cephalothorax on the shimp.', '20110113 15:35:24.380', 'DF95BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
