GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(634, 2488, 'dsg-description', 'self', 'Bell margin is lined with several hundred fine tentacles. The 4 radial canals are attached to white gonads form a "cross" which gives the species the common name "Cross jelly". ', '20110113 15:43:54.100', 'F990BBE5-A724-E811-80E1-005056990C7D')
