INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(641, 3851, 'dsg-taxonomist-assessment', 'self', 'John Yeh (UH) - The synaphobranchid observed by MBARI on T945 at Davidson Seamount looks like either Histiobrachus bathybius or Ilyophis arx. I (Dr. Yeh) collected both species in NWHI in 2009. In photographs they look very similar - both having very small round pectoral fins and dorsal insertion is level with the pectoral fins. However, looking at both specimens side by side they differed most distinctly by gill slits. I. arx has small distinctly separated gill slits while openings in H. bathybius are larger and almost confluent. They also differ in in head pore counts and dentition (not visible in in situ video or images). They occur similar depths.', '20110818 15:53:57.190', 'B695BBE5-A724-E811-80E1-005056990C7D')
GO
