INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(699, 132, 'dsg-range', 'self', 'West coast, North America. This species is not found offshore Monterey Bay.', '20150402 15:57:51.973', 'EEE897E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(702, 420, 'dsg-description', 'self', 'Large, uniformly light to medium gray-brown. Long snout, with tip acutely rounded and extending far beyond indented pectoral fins. One to five (usually two) nuchal thorns, and a continuous row of tail thorns. Posterior pelvic fins are elongate, notched and rounded. Tail moderately long and narrow; dorsal fins separated by a large interdorsal thorn. Anterior pelvic fins (walking legs) appear white-tipped in darker animals. In mature males, the claspers are long, narrow and white-tipped (visible in darker animals).', '20160707 09:12:33.460', '9EEA97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
