INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(710, 5477, 'dsg-description', 'self', 'A very distinctive species and the only known species off Southern California; it has numerous small integumental photophores and a much larger photophore on each eyelid and large club suckers.', '20150401 15:28:10.027', '5697BBE5-A724-E811-80E1-005056990C7D')
