INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(711, 5477, 'dsg-range', 'self', 'Known off Southern California and Northern Hawaii waters.', '20110511 08:23:18.053', '5797BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(713, 1743, 'dsg-description', 'self', 'Small snake eels with  relatively thin head and most times with no white on the jaw; potentially juvenile Lycenchelys croatalinus.', '20190529 13:57:18.423', 'B4F097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(714, 1744, 'dsg-description', 'self', 'Adults are larger than Lycenchelys sp. 1. Note white coloration on lower jaw. When pectoral fins are splayed, they appear white.', '20190521 09:54:37.643', 'B7F097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
