INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(718, 1503, 'dsg-description', 'self', 'This species has an elongate body with a luminous organ at the end of the tail and tiny eyes close to the snout. It has several rows of small teeth and large jaws. The species is black, sometimes with a white line or groove on either side of the dorsal fin. The Pelican Eel is the only species in the family Eurypharyngidae.', '20110509 11:35:36.223', '6DF097E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(719, 1503, 'dsg-range', 'self', 'Occurs in midwaters of tropical and temperate seas worldwide.', '20110509 11:36:41.073', '6EF097E5-A724-E811-80E1-005056990C7D')
GO
