INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(747, 492, 'dsg-description', 'self', 'Dorsal color uniformly light gray or mottled gray-brown with faint eyespots sometimes visible on the pectoral fins. Ventral color white, appearing as a white rim on the snout and pectoral fins. Snout shaped more acutely in males. Discontinuous row of medial thorns rarely seen in imagery.', '20160707 09:15:05.770', '1CEB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
