INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(750, 489, 'dsg-description', 'self', 'Medium gray to dark gray, pectoral fins with dark trailing margins. Claspers in mature males are long, narrow and white-tipped.', '20160707 09:22:33.833', '02EB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(751, 490, 'dsg-description', 'self', 'Dark-colored (plum, brown, black). Juveniles and immature animals with distinctive dark "v" shape on snout. Snout shaped more acutely and alar thorns prominent in males. Reportedly may have 1–3 nuchals, no mid-back thorns, line of white tail thorns usually prominent, dorsal fins close together (no interdorsal thorn). Claspers white-tipped in males.', '20160707 09:32:23.433', '0AEB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(752, 490, 'dsg-range', 'self', 'Japan and northern Kuril Islands to western Bering Sea, eastern Bering Sea and Gulf of Alaska south to the Gulf of California.', '20190930 14:06:48.027', '0BEB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(753, 490, 'dsg-habitat', 'self', 'Benthic, mud, canyon walls, and other hard substrate.', '20150808 18:30:12.277', '0CEB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(754, 486, 'dsg-habitat', 'self', 'Benthic, mud, or hard substrate.', '20150808 18:29:19.643', 'F5EA97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(755, 486, 'dsg-description', 'self', 'Chocolate brown (occasionally lighter-colored) with darker mottling and spots; white spotting is often observed as well. Disc wider than length. Continuous line of thorns along the mid-line of body and tail. Scapular thorn pairs (2–3) present on shoulders, but not normally visible in imagery. Short tail, with two small, closely spaced dorsal fins. Posterior pelvic fins lobate, relatively long, and narrow. Wide claspers in mature males. Note: molecular work has established that A. badia and A. hyperborea are the same species (see Eschmeyer''s Catalog of Fishes, IUCN, and Last et al. 2016).', '20190430 07:21:42.277', 'F6EA97E5-A724-E811-80E1-005056990C7D')
GO
