INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(1568, 575, 'dsg-description', 'self', 'Bell-shaped (medusoid) doliolid with four muscle bands. All known specimens have occurred as solitary individuals, the majority with buds. Living specimens have a medusoid shape yet are bilaterally symmetrical. The buccal opening is very large and highly elastic, capable of expanding to the full height (diameter) of the animal, and of contracting to less than 5% of height.', '20150807 12:59:45.523', '86EB97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(1569, 2640, 'dsg-description', 'self', 'Lacking long stinging tentacles; 8 bell lobes; may capture food on the surface of the bell using mucus to ensnare zooplankton prey; cilia transport the food to the bell margin and tentacles, then pass it to the frilly manubrium.', '20150423 15:00:02.680', 'A491BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(1570, 2640, 'dsg-size', 'self', 'Bell up to  40 cm diameter.', '20150423 15:00:07.947', 'A591BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
