  VALUES(1574, 2609, 'dsg-description', 'self', 'Twenty relatively short, somewhat stiff tentacles which alternate with 20 rhopalia around the bell margin; Bell has 40 lappets; A single long tentacle, with unknown function, trails behind the jelly; 8 light-colored gonads are large and obvious, surrounding the base of the stomach.', '20150423 14:48:06.443', '7C91BBE5-A724-E811-80E1-005056990C7D')
