  VALUES(1607, 2537, 'dsg-description', 'self', ' 1). All “little red jellies” below 3,000 m should be annotated as Benthocodon unless sampled and confirmed to species 2). Both Benthocodon and Pectis (prior name Voragonema) have a hole in the subumbrella. 3).The presence of centripetal canals would indicate Pectis sp., but these are rarely seen on camera.', '20181105 07:20:11.260', '3191BBE5-A724-E811-80E1-005056990C7D')
