INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2006, 739, 'dsg-description', 'self', 'Branches originating from the main branch just 1 cm from the basal attachment and filling approximately 160° of the flabellate plane. Branching is dichotomous and the branching axils are quite narrow, about 10–15°. The axis is straw colored, the calyces white. Calyces are arranged in whorls of 3 or 4 (usually 4) and face upward. There are 10–12 whorls per 3 cm branch length, the whorls spaced 1.2–1.3 mm apart; the whorl diameter is 2.8–3.9 mm. Calyces are 1.5–2.0 mm in horizontal length. The basal scales are 0.8–0.9 mm in height and have rounded dorsolateral edges. Each basal scale bears a smooth spine on its dorsolateral margin that extends up to 0.55 mm. These spines are round in cross section, about 0.1 mm in diameter at the base. Most of these spines also have a lower secondary spine or extension on their sagittal side, these spines only 0.12–0.15 mm in height and flattened in shape. The buccal scales are 1.0–1.05 mm in length and have rounded dorsolateral edges. Each calyx bears 4 (rarely 6) perfectly smooth, slender buccal spines, intact spines up to 0.6 mm in length and 0.1 mm in basal diameter. The crescent-shaped infrabasal scales are up to 0.45 mm in height; the two adjacent coenenchymal scales are often reflected upward near the calyx. The opercular scales are triangular in shape, with a pointed tip. The operculars are longitudinally creased above and keeled on their inner surface; their edges are finely serrate. The abaxial operculars are symmetrical in shape, 0.95–0.97 mm in length, with a L:W of 2.2–2.4. The 4 lateral operculars are only slightly asymmetrical, 0.71–0.90 mm in length, with a L:W of 1.7–2.1. The small adaxial operculars are symmetrical, about 0.7 mm in length, with a L:W of about 2.', '20120302 14:21:00.587', 'B6EC97E5-A724-E811-80E1-005056990C7D')
GO
