INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2030, 359, 'dsg-description', 'self', 'Long, white, thin. Stems eminate from basal branches. Polyps are very tiny and probably cannot be seen on video, rather it is the calyces that are observable in close-ups. Colonies dichotomously or pinnately branched, or unbranched. Calyces arranged in whorls, the calyces always facing downward. Each polyp enclosed by 3 or 4 pairs of unfused body wall scales (1 pair of basals, 1 or 2 pairs of medials, and 1 pair of buccals), 1–3 pairs of small adaxial buccal scales, and occasionally additional small, unpaired scales on the adaxial body surface. Distal margin of body wall scales often lobate of spinose; dorsolateral edge of basal scales often ridged. Operculum consists of 8 triangular scales, each with a pronounced medial keel on its inner surface. Coenenchymal scales usually elongate or elliptical in shape, often bearing tall vertical keels or ridges. ', '20140803 15:08:06.193', '44EA97E5-A724-E811-80E1-005056990C7D')
GO
