INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2042, 3864, 'dsg-description', 'self', 'Coloration of the tentacles and the distal regions of the polyps (anthocodiae) is salmon pink; basal portion of polyps white; the holdfast and lower region of the stalk are white; the branches of the stalk and the middle to upper parts of stalk are pale pink. The coloration is permanent and was observed in situ and in all preserved specimens as well, including those collected in 1973. Polyps non-retractable.', '20150406 11:03:54.493', 'D995BBE5-A724-E811-80E1-005056990C7D')
