INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2045, 2111, 'dsg-description', 'self', 'Body rounded and very slightly compressed, with very loose, flaccid skin; body tapering to a small rounded tail. Head very large and globose, roughly cuboid and bearing especially prominent open lateral-line canals; eyes dorsolateral and covered with a clear ‘window’ of skin; mouth large, oblique to nearly vertical, with relatively small, sharp slender teeth.', '20150430 14:58:37.610', '23F397E5-A724-E811-80E1-005056990C7D')
