INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2859, 5685, 'dsg-description', 'self', 'Long transparent red, purple, or white tentacles with a darker colored center. Exhibits both deposit and predatory (raptorial) feeding behaviors.', '20150512 07:44:56.550', '0D99BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
