GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2863, 5686, 'dsg-description', 'self', 'White, 10 arms. Identification established via specimens trawled from Station M (4,070 – 4,135 m by R/V New Horizon). ', '20170801 13:03:54.923', '1199BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2866, 5687, 'dsg-description', 'self', 'Opaque pink, not shiny. This possibly new genus is close to the new Hansenothuria, but differs by the presence of mid ventral tube feet.', '20150329 14:25:28.470', '1799BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2872, 5694, 'dsg-description', 'self', 'Very large (can be over 20 cm in length), flared pleopods; this the first record from the Eastern Pacific. Legs on the abdomen are located at right angles laterally--only seen in penaeoids. Note that this name is still in flux. The name C. monstruosus was given to the larval form of this animal years ago. The name of the adult (P. armatus) will take precendence now that they are known to be the same animal. No ruling has been made by the ICZN as of Nov. 2018.', '20190123 10:29:11.200', '2499BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2873, 5694, 'dsg-consulting-taxonomist', 'self', 'Mary Wicksten, Professor, Texas A&M University, College Station, Texas.', '20150330 13:24:59.130', '2599BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2874, 5688, 'dsg-description', 'self', 'Long (can reach at least 35 cm), thin, white; sometimes appears to have a "bulb" at the base where it enters the sediment; may not be sessile (may be capable of readily moving)', '20130502 11:58:20.423', '1C99BBE5-A724-E811-80E1-005056990C7D')
GO
