INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2893, 5702, 'dsg-description', 'self', 'Long arms, elongate body, large fins. C. murrayi often has heavier pigmentation around the arms and lighter pigmentation on head and mantle, particularly near the eyes.  The critical factor, however, are the extremely small eyes. Even though some other cirroteuthids and stauroteuthids have small eyes, those of C. murrayi are distinctly smaller and they don''t have lenses.', '20150327 11:34:22.680', '2F99BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2894, 125, 'dsg-description', 'self', 'Occasionally observed at the surface, but they remain buried most of the time. Animals in this genus are difficult to tell apart unless collected.', '20150407 12:43:04.423', 'CAE897E5-A724-E811-80E1-005056990C7D')
GO
