INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2994, 5743, 'dsg-description', 'self', 'The overall appearance of the colony is brown-red in color. Nectophores, with upper and upper lateral surfaces densely covered in patches of nematocysts. The bracts are nearly transparent and give the siphosome a ragged appearance rather than a well-defined outline.', '20150417 14:57:03.900', '5B99BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(2995, 5742, 'dsg-description', 'self', 'The orange-white tinge of the siphosome, with deep red gastrozooids, contrasts with  the complete lack of color in the nectosome. Large nectophores with patches of nematocysts covering their upper and upper-lateral sides. Refractile cells scattered in and around these patches. Bracts, gastrozooids and numerous palpons give the siphosome a relatively thick and well-defined fleece-like outline.', '20150417 14:57:42.713', '5699BBE5-A724-E811-80E1-005056990C7D')
GO
