INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(3040, 5768, 'internal-video-lab-only-comment', 'self', 'Sample D178-A27 collected and sent to Karen Sanamyan for ID. This is potentially a new species, however the specimen was badly damaged during collection and a description may not be possible. Large white disk-shaped specimen is a species of the family Actinostolidae and belongs to the genus Sicyonis. Unfortunately its interior was in part macerated to check all necessary morphological features but from the features we were able to examine we sure that this is a Sicyonis. This genus contains several species most of which were recorded from Atlantic (in particular North Atlantic) and some of these N. Atlantic species we had a chance to examine. Only one imperfectly known species was recorded in Pacific (from the Sea of Japan). Your specimen most probably is undescribed species, but I''m not sure if it would be possible to describe it basing on only one damaged specimen. From Daphne Fautin: This is potentially Hertwig''s 1882 species Sicyonis tubulifera, that was described from Japan.', '20150325 13:20:41.130', '8999BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
