INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(3139, 5546, 'dsg-description', 'self', 'Large, parasol-shaped sponge 32.5 cm total length with 2-4 10.5 mm long apical extensions ending in 3.8 mm diameter discs. Parasol is 2.7 cm in diameter with fifty-four 2.4–3.7 cm long filaments radiating in all directions. Stalk is 1–2.1 mm in width and ends in a terminal rhizoid 5.5 cm long and 2.6 cm wide. On the stalk, 7.5 cm below the parasol an oocyte-embryo swelling is present that is 1.9 cm long and 2.9 mm. Younger animals have not have developed apical disks or oocyte swellings. ', '20170928 14:21:59.663', 'EE97BBE5-A724-E811-80E1-005056990C7D')
GO
