INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4269, 2831, 'dsg-description', 'self', 'Compare with Pycnopodia helianthoides and shallower depths. There is some potential that they are the same species, however this is still unclear. 12-20 arms, disc may be relatively smaller than in P. helianthoides. These seastars develop "galls" in their arms, which are indicative of the presence of an endoparasitic eulimid gastropod (Asterophila rathbunasteri). Readily lose their arms. ', '20181114 12:44:45.277', 'D392BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4270, 2828, 'dsg-description', 'self', 'Compare with Rathbunaster californicus. Purple, reddish-orange, yellow, or brown with 15 -24 arms. Arm to disc ratio = 2.5 to 3.5.', '20150121 13:19:32.130', 'C692BBE5-A724-E811-80E1-005056990C7D')
GO
