  VALUES(4297, 133, 'internal-video-lab-only-comment', 'self', 'The genus for this animal has gone back and forth; we (Tomio, Erica and I) prefer Albatrossia.', '20150402 13:13:03.943', 'FCE897E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4298, 203, 'dsg-description', 'self', 'White body with red arms and fin tips. No long cirri along sucker row (compare with Cirrotheuthids).', '20150327 11:28:42.110', 'B5E997E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4299, 203, 'internal-video-lab-only-comment', 'self', 'When sucker rows cannot be observed, it is possible that some Cirroteuthids may be annotated as this species.', '20150506 10:29:29.153', 'B6E997E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4300, 5984, 'dsg-description', 'self', 'Very large animal. Lower ~25% of the arms appear to extend below the bottom of the web. Red to orange coloration with a diffuse white band in the upper region near/under the eye. Eye does not look particulary small or degenerate on specimens observed in video (compare with C. murrayi). Large barrel-shaped suckers (vs stalked suckers as in C. magna). Skin and underlying body tissue appears soft, exhibiting curtain-like wrinkles.', '20150203 09:44:17.370', '849ABBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4301, 5985, 'dsg-description', 'self', 'Very short arms, orangish-red coloration with speckling. A diffuse white band well below the eye. Note the distinctive blue eyes.', '20211027 15:48:39.830', '879ABBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4302, 5986, 'dsg-description', 'self', 'Red. Note the very small eyes. Frequently observed resting on the seafloor.', '20150327 11:07:21.913', '899ABBE5-A724-E811-80E1-005056990C7D')
GO
