INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4306, 5980, 'dsg-description', 'self', 'Small, relatively flat compared to the various elongate Grimpotheuthis species. Peach-colored, small fins used for steering (vs. robust swimming). White spots, if present, may not be observable on video.', '20150327 10:24:19.470', '789ABBE5-A724-E811-80E1-005056990C7D')
