INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4307, 3001, 'dsg-description', 'self', 'Orangish-red to purple-red with white-blue spots in rows (areolae; not previsously reported for this species). Blue eyes.', '20150202 11:37:35.977', '8A93BBE5-A724-E811-80E1-005056990C7D')
