  VALUES(4325, 5761, 'dsg-description', 'self', 'Bent tail; pointed rostrum; yellow/gold eyes; red/orange body; narrow telson with cleft; antennular peduncle about two-thirds as long as antennal scale.', '20150916 08:39:01.520', '7D99BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4326, 5761, 'internal-video-lab-only-comment', 'self', 'Typically smaller than Birsteiniamysis inermis and with shorter, wider antennal scales; morphological variation within specimens we have identified as "californica" could represent more than one species.', '20150918 10:06:41.637', '7E99BBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(4327, 5989, 'internal-video-lab-only-comment', 'self', 'Typically slightly larger than Boreomysis california and with longer, narrower antennal scales; body a little less bent.', '20150414 14:12:54.310', '8C9ABBE5-A724-E811-80E1-005056990C7D')
