INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(6594, 1407, 'dsg-description', 'self', 'Light to dark brown or gray with dark mottling around the disc perimeter and tail. Dark dorsal ocelli (eyespots) are prominent. Also white-spotted in some animals, while others may only have two white spots behind the ocelli. Long snout extends beyond indented pectoral fins; wide disc. Short tail often looks striped from a distance. Mature males have relatively long, wide, white-tipped claspers.', '20160707 09:48:14.663', 'FCEF97E5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
