  VALUES(6787, 6355, 'dsg-reference', 'self', 'Pugh, P.R. and S.H. Haddock (2016). A description of two new species of the genus Erenna (Siphonophora, Physonectae, Erennidae), with notes on recently collected specimens of other Erenna species. Zootaxa, 4189: zootaxa 4189 4183 4181. http://dx.doi.org/10.11646/zootaxa.4189.3.1', '20171023 08:44:28.060', 'B99BBBE5-A724-E811-80E1-005056990C7D')
