INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(6788, 6355, 'dsg-description', 'self', 'Tentilla covered by a red-fluorescent layer. First record of an invertebrate producing red bioluminescence (produced by fluorescence of blue-green bioluminescence). Main part of the tentacle, with its tentilla, can be extended away from the siphosomal stem on a long peduncle. Twitches tentilla to mimic the movement of copepods to attract midwater fishes. Each tentilla may contain more than 3,000 powerful nematocysts. Bracts have dots at the end of them (concentrated nematocysts). Eggs are very large and visible, as are the clusters of male gonophores.', '20180926 16:09:53.797', 'BA9BBBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(6789, 672, 'dsg-description', 'self', 'Main part of the tentacle, with its tentilla, can be extended way from the siphosomal stem on a long peduncle. Lures wriggle in an uncoordinated manner. Bracts have dots at the end of them (concentrated nematocysts). Slightly deeper and more abundant in GoC.', '20180926 16:09:09.107', '2BEC97E5-A724-E811-80E1-005056990C7D')
GO
