INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(7064, 3722, 'dsg-description', 'self', 'Compare with Antimora microlepis. Distinct silvery color, very long chin barbel, rounded pectoral fins, long first dorsal fin spine, blunt snout with terminal mouth. These are tentative ID''s; the anal fin is not notably indented, rather it is just the opposite (E. Burton, personal communication 2017). Possibly Laemonema or Physiculus rastrelliger.', '20170606 10:37:18.010', 'BA94BBE5-A724-E811-80E1-005056990C7D')
GO
