INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(7160, 6424, 'dsg-description', 'self', 'Tan-yellow periostracum, no shouldering between sutures, fine spiral striae. Not consistent with Retimohnia sp. A, nor Aulacofusus/Colus trophius (for which the taxonomy is currently in flux). Egg cases small, rounded, leaf-like attachment.', '20170823 14:19:16.457', '0F9CBBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(7165, 6426, 'dsg-habitat', 'self', 'Benthic. Tend to be attached to the seafloor or low rocks (vs. perched on high objects).', '20170825 10:00:54.010', '119CBBE5-A724-E811-80E1-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(7166, 6426, 'dsg-description', 'self', 'Brown, grading to white tips (vs. reddish-brown), with long pinnules on the arms which make them look relatively thick.', '20170825 09:23:08.400', '129CBBE5-A724-E811-80E1-005056990C7D')
GO
