INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(7230, 6453, 'dsg-description', 'self', 'Long, parasol-shaped sponge measuring 30 cm in total length with a stalk width of 1 mm. Parasol diameter of 2.6 cm with seventy-six long filaments, 3.3–4.2 cm in length, radiating out in all directions from the parasol edge. Spheroid top-knot on apical surface of parasol measures 9 mm in length and 7.3 mm in diameter with dense, small filaments radiating in all directions in lengths from 4–9 mm. On the stalk 6.9 cm below the parasol is an oocyte swelling (immature specimens will not have this). Basal holdfast for attachement to hard substrate.', '20170928 11:53:52.133', '349CBBE5-A724-E811-80E1-005056990C7D')
GO
