INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8347, 6615, 'dsg-description', 'self', 'Body elongate, narrow. Notum outline with four invaginations; edge has a ruffled appearance. Dorsum covered with numerous, densely packed elongate tubercles or projections, oriented in different directions, forming a zigzagging pattern in some areas. Velum wide, forming two triangular lateral projections, with several frontal irregular indentations. Rhinophores short and wide, with 9 simple lamellae, located on anterior end of notum. Rhinophoral sheaths elongate, with 12 branched papillae around distal edges. Foot smooth, rounded posteriorly, visible dorsally at posterior end and in notum invaginations. Background color of notum black. Dorsal tubercles primarily white to greyish-brown near posterior notum, giving the body a light appearance, becoming darker towards head, turning completely black on anterior notum; this gives a black and white appearance with a greyish transitional area mid-length, forming a wedge of black pigment. Notum edge primarily white, except for anterior-most end that becomes dark grey. Velum completely black. Rhinophoral sheaths black with grey edges. Rhinophores with black stalks and beige sheath papillae and clubs. Foot dark grey, surrounded by a thin white line.', '20181211 11:42:39.280', '056240EA-7CFD-E811-80E5-005056990C7D')
GO
