INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8355, 6618, 'dsg-description', 'self', 'Body long, narrow, with 4-6 pairs of simple, elongate, dorso-lateral cerata. Velum composed of 4 narrow and elongate papillae. Rhinophores with very elongate stalks. Rhinophoral sheaths with 4 elongate, simple papillae on distal edges, the innermost papilla being much larger than the other three. Rhinophoral clubs elongate, with 11 simple lamellae. Color uniformly translucent white with some internal organs visible through the body wall as beige or yellowish areas.', '20181211 12:28:51.870', '7C08D85E-83FD-E811-80E5-005056990C7D')
GO
