INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8360, 6620, 'dsg-description', 'self', 'Body elongate, wide, with numerous elongate, dorso-lateral cerata. Cerata arranged in densely packed rows, running from behind oral tentacles to posterior end of body. Cerata increase in size in each row, lateral cerata typically shorter, dorsal cerata longer. Oral tentacles tentacular, narrow, elongate. Rhinophores elongate (Figs. 2F), with low irregular swellings. Body color brown-ochre, covered with densely arranged yellowish spots. Rhinophores and oral tentacles same color as body but two distal thirds yellowish-white. Cerata also with same color as body with digestive gland branches partially visible, particularly in smaller cerata, giving them a reddish tinge; cnidosacs white.', '20181211 12:35:07.410', 'CCF7AE3E-84FD-E811-80E5-005056990C7D')
GO
