INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8367, 6624, 'dsg-description', 'self', 'Body elongate, narrow, with numerous elongate, thin, dorso-lateral cerata. Cerata arranged in densely packed rows, running from behind oral tentacles to posterior end of body. Cerata increase in size in each row, lateral cerata typically shorter, dorsal cerata longer. Oral tentacles short and wide, nearly conical in live animal. Foot corners tentacular, short, wide, almost spherical. Rhinophores elongate, smooth. Body color cream to reddish-orange, semi translucent, with viscera visible through skin as a yellowish mass. Oral tentacles the same color as body, rhinophores redder and darker. Cerata translucent pale orange, with red digestive branches and white cnidosacs.', '20181211 12:44:44.103', '0C583793-85FD-E811-80E5-005056990C7D')
GO
