INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8369, 1288, 'internal-video-lab-only-comment', 'self', 'There is a name change in WoRMS, changing this to Neognathophausia. According to Eric Theussen he does not concur: One, in general the Russian taxonomists seem to have a lot of publish or perish pressure, and they churn out a bunch of garbage. Two, there is no supporting genetic information to back up the very minor morphological differences between Neognathophausia and Gnathophausia. Three, when Casanova last analyzed the genus, if there were reasons to break up Gnathophausia, he would have done so.', '20181213 12:58:58.873', '67397AD2-19FF-E811-80E5-005056990C7D')
GO
