  VALUES(8384, 1419, 'dsg-reproduction', 'self', 'Eggcases: 70-110 mm in length. Golden-yellow when <1 mo old, after 1 mo egg cases oxidize and become black. Long tendrils on both anterior and posterior ends, thick flanges on both anterior and posterior keel, flanges along the lateral edges resembles a “T” in cross-section. Degrading egg cases will sometimes be covered in a white bacterial mat.', '20190123 13:13:13.500', '700012B1-531F-E911-80E7-005056990C7D')
