  VALUES(8647, 193, 'internal-video-lab-only-comment', 'self', 'De Leo poster cites Canadian occurrence. Also, note that, although the published description indicates the body is extremely firm (Harbison et al., 2001), the consistency observed in collections is actually quite delicate (K. Schlining).', '20201028 12:25:55.190', '3E406114-DB17-EB11-80F2-005056990C7D')
