INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8649, 193, 'dsg-description', 'self', 'Body slightly compressed in tentacular axis. Viewed from the aboral end, the body has 16 slight ridges, with a broad and prominent row of comb plates occurring on every other ridge. The body consistency is extremely firm. Auricles are short, wide and fleshy, but aren''t very mobile. The pair of oral lobes are fleshy, but appear to be more delicate in larger specimens. Oral lobes are only slightly longer than the body. ', '20201028 11:31:17.967', '549E30C4-4B19-EB11-80F2-005056990C7D')
GO
