  VALUES(8704, 5769, 'dsg-reference', 'self', 'Sherlock, R.E., K.R. Walz, and B.H. Robison (2016). The first definitive record of the giant larvacean, Bathochordaeus charon, since its original description in 1900 and a range extension to the northeast Pacific Ocean. Marine Biodiversity Records, 9: 79. https://doi.org/10.1186/s41200-016-0075-9.', '20201222 18:26:40.133', '7B2A7249-C644-EB11-80F4-005056990C7D')
