INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8705, 1090, 'dsg-description', 'self', 'Tube-dwelling polychaete worm with four pairs of red-orange lamellate branchia. Functional gut, with retracile buccal tentacles. Tubes are parchment-like and covered with metallic sulfur.', '20201222 18:42:22.373', 'BE3D107B-C844-EB11-80F4-005056990C7D')
GO
