INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8753, 3007, 'dsg-description', 'self', 'Body small, gelatinous, and semi-transparent to orange in color with large, prominent eyes and eight short arms. Arm length less than mantle length. Sexual dimorphism between sexes. Mature males lack hectocotylized arm, but do possess enlarged distal suckers on third right arm. Mature females have a ring-shaped light organ around the mouth.', '20201223 15:48:17.897', 'A5441554-7945-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
