GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8756, 3007, 'dsg-reproduction', 'self', 'Upon reaching sexual maturity, iridescence of eyes and digestive glands disappears, pigmentation increases slightly, and individuals migrate to deeper water. Mature males develop enlarged salivary glands, possibly to secrete chemical attractant for females. Bioluminescent organ in females may be used for reproductive signalling to males. Females brood eggs underneath their arms.', '20201223 15:50:31.403', 'D5E7A8A3-7945-EB11-80F4-005056990C7D')
GO
