INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8772, 6709, 'dsg-description', 'self', 'Dramatic sexual dimorphism. Females globular in shape with a large head and mouth, sharp teeth, distensible stomach, and uniform dark brown or black color. First doral fin ray of female modified into a short lure (illicium) with bulbous, luminous tip (esca). Dwarf males slender in shape and are free-living (non-parasitic). Males have large olfactory organs and inflated nostrils.', '20201223 16:10:23.973', '0EF67C6A-7C45-EB11-80F4-005056990C7D')
GO
