GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8782, 2980, 'dsg-description', 'self', 'A pair of long, elliptical fins runs the length of the body. Tentacles drop off in early life stages, and adults possess just eight arms. Long arms bear hooks instead of suckers along most of their length. Body typically bright red in color with numerous photophores, including prominent photophores at the tip of each arm. Octopoteuthis deletron possess one (rather than two) tail photophores.', '20201223 16:22:51.277', '0CC6E727-7E45-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8783, 2980, 'dsg-size', 'self', 'To 17 cm mantle length.', '20201223 16:23:11.057', '6B48B433-7E45-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8784, 2980, 'dsg-color', 'self', 'Bright red. Fins may have light edges. Juveniles are a lighter color, semi-transparent.', '20201223 16:23:39.210', '65D07944-7E45-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8785, 2980, 'dsg-reproduction', 'self', 'Mature males lack hectocotylus, but have a large penis able to extend well beyond the opening of the mantle. Same-sex mating behavior has been reported, likely as a strategy for reproductive success in an environment where mates are few and far between.', '20201223 16:23:56.630', 'E01EDE4E-7E45-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8786, 2980, 'dsg-range', 'self', 'Eastern North Pacific Ocean (from Alaska to Baja California), off Peru, and potentially off Japan.', '20201223 16:24:30.170', '00EDDB62-7E45-EB11-80F4-005056990C7D')
GO
