INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8794, 1255, 'dsg-description', 'self', 'Transparent hyperiid amphipod carries a barrel-shaped shelter made from the gelatinous tissues of salps and pyrosomes. Fifth pereiopods modified to claw-like shape to grasp barrel. Both males and females hijack pelagic tunicates as barrels, with females using the gelatinous host as food and shelter for her larvae. Thick, bristly uropods well developed. ', '20201223 16:30:52.710', '72F7DE46-7F45-EB11-80F4-005056990C7D')
GO
