INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8807, 1070, 'dsg-description', 'self', 'Highly specialized chemosynthetic vent worm resides in smooth, white tubes with red plume protruding. Heavily vascularized plume is comprised of fine lamellae and split along length. Muscular vestimentum is wing-shaped. Trunk contains large trophosome housing chemo-symbiotic bacteria. Parchment-like tubes are flexible and made of chitinous protein. Tubeworms form clusters on rock and mineral substrate in areas of diffuse venting.', '20201223 16:40:30.310', 'A6FD259F-8045-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8808, 1070, 'dsg-size', 'self', 'To 1.5 m tall.', '20201223 16:41:39.717', '586384C8-8045-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8809, 1070, 'dsg-color', 'self', 'Distinctive red plumes and white tubes.', '20201223 16:42:08.080', '1E546CD9-8045-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8810, 1070, 'dsg-reproduction', 'self', 'Males broadcast sperm, but fertilization occurs within the tube of the female. Trochophore larvae facilitate dispersal to new hydrothermal vent fields. Symbiotic bacteria are acquired from the environment when suitable habitat for settlement has been found.', '20201223 16:42:34.120', 'F597F1E8-8045-EB11-80F4-005056990C7D')
GO
