INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8817, 621, 'dsg-description', 'self', 'A thin web of tissue connects eight arms. Two retracile filaments extend from the mantle. Distinctive large, bright blue eyes. A pair of fins on the lateral side of the mantle aid in locomotion. Possesses two large photophores below the fins with a number of smaller light organs in the skin. The tips of all eight arms are also capable of bioluminescence. May invert the webbing between its arms and expose thin, fleshy cirri when disturbed, giving a characteristic pineapple-like appearance. Dark red in color with variations ranging from amber to dark orange to brown.', '20201223 16:52:58.470', 'CE70E84D-8245-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8818, 621, 'dsg-size', 'self', 'To 30 cm total length and 13 cm mantle length.', '20201223 16:53:46.720', '9E28D879-8245-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8819, 621, 'dsg-reproduction', 'self', 'Iteroparous, with multiple reproductive cycles. Spawning occurs in deep water. Hatchlings possess pair of fins, which are absorbed during larval development and replaced by a more anterior pair of fins. Juveniles may thus have two pairs of fins depending on developmental stage.', '20201223 16:55:09.167', 'E5A3FCAA-8245-EB11-80F4-005056990C7D')
GO
