INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8835, 5794, 'dsg-description', 'self', 'Head blunt and orange in color. Trunk has uniform width, tapering at junction with tail, and is bright orange in color. Body exhibits a slight ventral bend at junction of trunk and tail. One pair of lateral fins, starting at trunk-tail junction. Both trunk and tail have traverse musculature. Tail transparent.', '20201223 17:08:06.917', '3B24907A-8445-EB11-80F4-005056990C7D')
