  VALUES(8843, 763, 'dsg-description', 'self', 'Medusa contains four simple, unbranched radial canals that connect to the ring canal. Bell has a wide velum. Manubrium is half to two-thirds bell height with a cross-shaped mouth. Four highly contractile tentacles are swollen and pigmented at base where they attach to the bell. Exhibits mutualistic symbiosis with pelagic tunicate Doliolula equus with hydroid polyps occurring on the doliolid''s buccal siphon. Hydroid polyps are singular and unbranched with root-like hydrorhiza. Autonomous tentacles may also adhere to doliolid host.', '20201223 17:19:36.0', 'E2080709-8645-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8844, 763, 'dsg-size', 'self', 'Hydroid polyps to 12 mm in height. Medusae to 4.6 mm diameter.', '20201223 17:20:17.657', 'BE021E2E-8645-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8845, 763, 'dsg-reproduction', 'self', 'Hydroid polyps bud one to three medusae at a time. Medusae are released when approximately 2 mm in diameter.', '20201223 17:20:38.747', 'F7E5AD3A-8645-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8846, 763, 'dsg-habitat', 'self', 'Mesopelagic, occurring on the pelagic tunicate Doliolula equus.', '20201223 17:21:14.700', 'FD031E50-8645-EB11-80F4-005056990C7D')
GO
