GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8848, 727, 'dsg-description', 'self', 'Outer bell hemispherical in shape. Interior of bell burnt tangerine in color, with ring and eight radial canals, manubrium, and gonads bright pink to lavender in color. Up to 220 tentacles occur in a single row along the edge of the bell.', '20201223 17:23:25.473', '4A73109E-8645-EB11-80F4-005056990C7D')
GO
INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
