INSERT INTO [dbo].[LinkRealization]([id], [ConceptDelegateID_FK], [LinkName], [ToConcept], [LinkValue], [LAST_UPDATED_TIME], [rowguid])
  VALUES(8859, 578, 'dsg-description', 'self', 'Individual zooids link together in a chain. Common stolon links individual zooids together. Zooids ovate, almost spherical, in shape with five girdling muscle bands and a thick tunic. Gut is U-shaped. Buccal siphon often hosts hydroids of Bythotiara dolioeques in mutualistic symbiosis.', '20201223 17:32:26.220', '254860E0-8745-EB11-80F4-005056990C7D')
